import React from 'react';
import WeatherFromLocation from './WeatherFromLocation';

const CityList = ({ cities }) => {
  return (
    <div>
      <WeatherFromLocation />
      <h2>Lista miast</h2>
      <ul>
        {cities.map((city) => (
          <li key={city}>
            <a href={`/weather/${city}`}>{city}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CityList;
